import React from "react";
import Styles from "./UI/styles.module.css";
import { ToDoProps } from "../../widgets/ToDoList/ToDoList";
import { ToDoId } from "../../app/store";

export function ToDoComponent(props:ToDoProps) {
	const id:ToDoId = props.id;
	const dateComplete = props.dateComplete;
	return (
		<div className={Styles.container}>
			<div>
				<div className={Styles.toDoTitleContainer}>
					<label htmlFor="ToDoTitle">{`${props.idInList}.`}&nbsp;</label>
					<h3 id="ToDoTitle" className={Styles.toDoH3}>{props.title}</h3>
				</div>
				<p className={Styles.toDoP}>{props.description}</p>
			</div>
			<button onClick={():void => props.funcDelete(id, dateComplete)}>Удалить</button>
		</div>
	);
}
